INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8001440126086', 'Valfrutta Zuppa Fibra Astucci GR 250', 'Mélange de légumes et céréales&quot; Soupe fibre&quot; 250G Ingcédients: orge perlé (30%), lavoine pelées (30%), les lentilles eston (30%), les haricots cassés (10%). Le produit peut contenir des traces de soja, de sésame, la moutarde et le lupin. Laver le produit. Cuisson sans trempaqe: placer le produit (250g) dans la casserole, ajouter 2 litres d\'eau (tiède) et, au goût, le céleri, la carotte et I oignon. cuit par ebullition pendant 40 minutes. Ajouter le sel après la cuisson. Cuisson avec trempaqe: Pour réduire le temps de cuisson, il est recommandé de faire tremper pendant au moins 8 heures dans 1 litre d\'eau. Egoutter et procéder à la cuisson comme décrit ci-dessus en réduisant le temps à environ 30 minutes. Idée supplémentaire: à la fin du temps de cuisson, ajouter une p ncée de romarin haché dissous dans une cuillère à soupe d\'huile d\'olive pour augmenter le parfum', 'https://static.openfoodfacts.org/images/products/800/144/012/6086/front_fr.4.400.jpg', '3.1', '0.5', '67.1', '1.6', '11.1', '18.4', '0.01', '0.00393700787401575', '', '1');

